    <a class="nav-link active mx-auto" aria-current="page" href="#">
        <img src="../../../assets/img/logo.png">
    </a>
    <a class="nav-link text-style" href="#">
        <div class="d-flex">
            <img class="img-fluid" src="../../../assets/img/bar-chart-2.png" alt="">
